import React from 'react';
import './Login.scss';

function Login(props) {
    return (
        <div className="login">
            <div className="login__container margin-left-2">
                <div className="login__header">LOGIN</div>
                <input type="text" className="login__input margin-top-8" placeholder="Username" />
                <input type="text" className="login__input margin-top-4" placeholder="Password" />
                <div className="row margin-top-4">
                    <div className="col-xs-6 col-sm-6 text-left">
                        <input type="checkbox" className="form-check-input margin-left-2" id="rememberCheck" />
                        <label className="form-check-label" for="rememberCheck">Remember me</label>
                    </div>
                    <div className="col-xs-6 col-sm-6 text-right">
                        <button type="submit" className="login__button">Sign In</button>
                    </div>
                </div>
            </div>
        </div>
    );
}
export default Login;
